import { Box } from '@mui/material'
import React from 'react'
import SearchIcon from '@mui/icons-material/Search';
import { InputBase } from '@mui/material';
import styled from '@emotion/styled';


const Component = styled(Box)`
height:45px;
background: #fff;
`

export const Search = () => {
  return (
    <Component>
        <Box>
            <Box>
                <SearchIcon/>
            </Box>
            <InputBase/>
        </Box>
    </Component>
  )
}
